(12, 13, 'Product', NULL, '<div class=\"product-details\">\r\n                    <div class=\"row align-items-center\">\r\n                        <div class=\"col-lg-5\">\r\n                            <div class=\"product-single-img\">\r\n                                <div class=\"product-active owl-carousel owl-loaded owl-drag\">\r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                <div class=\"owl-stage-outer\"><div class=\"owl-stage\" style=\"transform: translate3d(0px, 0px, 0px); transition: all 0s ease 0s; width: 2110px;\"><div class=\"owl-item active\" style=\"width: 527.5px;\"><div class=\"item\" style=\"position: relative; overflow: hidden;\">\r\n                                        <img src=\"assets/images/product/4.jpg\" alt=\"\">\r\n                                    <img role=\"presentation\" src=\"https://demo.sslwireless.com/ui/futurebazaar/assets/images/product/4.jpg\" class=\"zoomImg\" style=\"position: absolute; top: -33.6335px; left: -465.183px; opacity: 0; width: 1007px; height: 855px; border: none; max-width: none; max-height: none;\"></div></div><div class=\"owl-item\" style=\"width: 527.5px;\"><div class=\"item\" style=\"position: relative; overflow: hidden;\">\r\n                                        <img src=\"assets/images/product-details/2.jpg\" alt=\"\">\r\n                                    <img role=\"presentation\" src=\"https://demo.sslwireless.com/ui/futurebazaar/assets/images/product-details/2.jpg\" class=\"zoomImg\" style=\"position: absolute; top: 0px; left: 0px; opacity: 0; width: 855px; height: 726px; border: none; max-width: none; max-height: none;\"></div></div><div class=\"owl-item\" style=\"width: 527.5px;\"><div class=\"item\" style=\"position: relative; overflow: hidden;\">\r\n                                        <img src=\"assets/images/product-details/3.jpg\" alt=\"\">\r\n                                    <img role=\"presentation\" src=\"https://demo.sslwireless.com/ui/futurebazaar/assets/images/product-details/3.jpg\" class=\"zoomImg\" style=\"position: absolute; top: 0px; left: 0px; opacity: 0; width: 855px; height: 725px; border: none; max-width: none; max-height: none;\"></div></div><div class=\"owl-item\" style=\"width: 527.5px;\"><div class=\"item\" style=\"position: relative; overflow: hidden;\">\r\n                                        <img src=\"assets/images/product-details/2.jpg\" alt=\"\">\r\n                                    <img role=\"presentation\" src=\"https://demo.sslwireless.com/ui/futurebazaar/assets/images/product-details/2.jpg\" class=\"zoomImg\" style=\"position: absolute; top: 0px; left: 0px; opacity: 0; width: 855px; height: 726px; border: none; max-width: none; max-height: none;\"></div></div></div></div><div class=\"owl-nav disabled\"><img src=\"data:image/jpeg;base64,\" data-filename=\"4.jpg\" style=\"width: 100%;\"><br></div><div class=\"owl-dots disabled\"></div></div>\r\n                                <div class=\"product-thumbnil-active owl-carousel owl-loaded owl-drag\">\r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                <div class=\"owl-stage-outer\"><div class=\"owl-stage\" style=\"transform: translate3d(0px, 0px, 0px); transition: all 0s ease 0s; width: 538px;\"><div class=\"owl-item active\" style=\"width: 124.375px; margin-right: 10px;\"><div class=\"item\">\r\n                                        <img src=\"assets/images/product/4.jpg\" alt=\"\"></div></div><div class=\"owl-item active\" style=\"width: 124.375px; margin-right: 10px;\"><div class=\"item\"><img src=\"assets/images/product-details/2.jpg\" alt=\"\">\r\n                                    </div></div><div class=\"owl-item active\" style=\"width: 124.375px; margin-right: 10px;\"><div class=\"item\">\r\n                                        <img src=\"assets/images/product-details/3.jpg\" alt=\"\">\r\n                                    </div></div><div class=\"owl-item active\" style=\"width: 124.375px; margin-right: 10px;\"><div class=\"item\"><br></div></div></div></div><div class=\"owl-dots disabled\"></div></div>\r\n                            </div>\r\n                        </div>\r\n                        <div class=\"col-lg-7\">\r\n                            <div class=\"product-single-content\">\r\n                                <h5>Parbotyo Honey: Nectar from the Chittagong Hill Tracts</h5>\r\n                                <p>Nestled in the pristine landscapes of the Chittagong Hill Tracts (CHT) in Bangladesh, Parbotyo Honey is a true embodiment of nature\'s bounty. This exquisite honey, distinct from the usual varieties found in the mainstream market, carries with it the essence of a unique ecosystem and the rich cultural heritage of the indigenous communities that harvest it.\r\n                                </p>\r\n                                \r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n<div class=\"product-tab-area\">\r\n                    <ul class=\"nav nav-mb-3 main-tab\" id=\"tab\" role=\"tablist\">\r\n                        <li class=\"nav-item\" role=\"presentation\">\r\n                            <button class=\"nav-link active\" id=\"descripton-tab\" data-bs-toggle=\"pill\" data-bs-target=\"#descripton\" type=\"button\" role=\"tab\" aria-controls=\"descripton\" aria-selected=\"true\">Origin and Collection</button>\r\n                        </li>\r\n                        <li class=\"nav-item\" role=\"presentation\">\r\n                            <button class=\"nav-link\" id=\"Information-tab\" data-bs-toggle=\"pill\" data-bs-target=\"#Information\" type=\"button\" role=\"tab\" aria-controls=\"Information\" aria-selected=\"false\">Taste and Aroma</button>\r\n                        </li>\r\n                        <li class=\"nav-item\" role=\"presentation\">\r\n                            <button class=\"nav-link\" id=\"Ratings-tab\" data-bs-toggle=\"pill\" data-bs-target=\"#Ratings\" type=\"button\" role=\"tab\" aria-controls=\"Ratings\" aria-selected=\"false\">Quality and Hygiene</button>\r\n                        </li>\r\n                    </ul>\r\n                    <div class=\"tab-content\">\r\n                        <div class=\"tab-pane fade show active\" id=\"descripton\" role=\"tabpanel\" aria-labelledby=\"descripton-tab\">\r\n                            <div class=\"container\">\r\n                                <div class=\"row\">\r\n                                    <div class=\"col-lg-12\">\r\n                                        <div class=\"Descriptions-item\">\r\n                                            <p>Parbotyo Honey is a labor of love meticulously crafted by native species of bees known as Serena bees. These bees, adapted to the diverse flora of the CHT region, collect nectar from an assortment of sources. They visit various types of fruits, forest plants, and even medicinal herbs that thrive in the misty hills. As a result, Parbotyo Honey is a true mixed flower honey, capturing the essence of this diverse ecosystem.<br><br>\r\n\r\nThe indigenous honey farmers of the Chittagong Hill Tracts employ traditional and sustainable methods to harvest this liquid gold. They carefully collect honey from nature\'s beehives without disturbing the delicate balance of their surroundings. The process is not just about honey; it\'s a harmonious interaction between humans and nature.\r\n</p>\r\n                                        </div>\r\n                                    </div>\r\n                                </div>\r\n                            </div>\r\n                        </div>\r\n                        <div class=\"tab-pane fade\" id=\"Ratings\" role=\"tabpanel\" aria-labelledby=\"Ratings-tab\">\r\n                            <div class=\"container\">\r\n                                <div class=\"rating-section\">\r\n                                    <div class=\"row\">\r\n                                        <div class=\"col-12\">\r\n                                            <p>Parbotyo Honey is not only renowned for its taste but also for its quality. Through initiatives supported by organizations like the United Nations Development Programme (UNDP), indigenous honey farmers have undergone training in modern honey harvesting techniques. This has elevated the hygiene and quality of the honey, ensuring it meets the stringent standards of the mainstream market.</p>\r\n                                        </div>\r\n                                        \r\n                                    </div>\r\n                                </div>\r\n                            </div>\r\n                        </div>\r\n                        <div class=\"tab-pane fade\" id=\"Information\" role=\"tabpanel\" aria-labelledby=\"Information-tab\">\r\n                            <div class=\"container\">\r\n                                <div class=\"Additional-wrap\">\r\n                                    <div class=\"row\">\r\n                                        <div class=\"col-12\">\r\n                                            <p>What sets Parbotyo Honey apart is its exceptional taste and aroma. It carries the subtle, sweet notes of various flowers and fruits, creating a symphony of flavors on the palate. Its fragrance, reminiscent of the CHT\'s lush landscapes, evokes a sense of connection to the natural world.</p>\r\n                                        </div>\r\n                                    </div>\r\n                                </div>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n\r\n<section class=\"product-area section-padding\">\r\n            <div class=\"container\">\r\n                <div class=\"row align-items-center\">\r\n                    <div class=\"col-lg-7\">\r\n                        <div class=\"offer-img\"><img src=\"data:image/png;base64,\" data-filename=\"honey.png\" style=\"width: 580px;\">\r\n                            <img src=\"assets/images/honey.png\" alt=\"\">\r\n                        </div>\r\n                    </div>\r\n                    <div class=\"col-lg-5\">\r\n                        <div class=\"offer-wrap\">\r\n                            \r\n                            <h5>Economic Empowerment:</h5>\r\n<p>The journey of Parbotyo Honey goes beyond just producing a delicious and high-quality product. It\'s about empowering the indigenous communities of the CHT. UNDP\'s support in forming associations and providing training has not only improved their livelihoods but has also enhanced their position in the honey value chain.</p>\r\n\r\n<h5>Sustainability and Biodiversity:</h5>\r\n<p>Parbotyo Honey embodies sustainability. The indigenous honey farmers understand the delicate balance of their ecosystem and are committed to preserving it. By practicing sustainable beekeeping and honey collection methods, they contribute to the preservation of the rich biodiversity of the CHT region.</p>\r\n\r\n<h5>A Symbol of Unity and Culture:</h5>\r\n<p>Parbotyo Honey isn\'t just a product; it\'s a symbol of unity among the indigenous communities. It represents their cultural heritage, their connection to the land, and their determination to thrive in harmony with nature.</p>\r\n\r\n<p>In every drop of Parbotyo Honey, you taste not just honey, but a journey of unity, empowerment, sustainability, and a deep connection to the Chittagong Hill Tracts. It\'s a testament to the beauty that can be achieved when people and nature work together.</p>\r\n                            \r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </section>', 1, '2023-08-28 09:52:20', '2023-08-29 06:57:35');
