(11, 75, 'কালোজিরা ফুলের মধু (Black Seed Flower Raw Honey)', 'মৌমাছি যে মধু তৈরি করে মৌচাকে জমা করে, সেই মধুই হচ্ছে কাঁচা মধু বা ‘র হানি’। সেটা গ্রাম গঞ্জের হাতে চাক কাটা মধু হোক বা বাক্সের ভেতরে পোষা মৌমাছি দিয়ে উৎপাদিত মধু হোক। এই দুই প্রকার মৌমাছিই যদি ফুল থেকে মধু সংগ্রহ করে, তাহলে এই দুই প্রকার মধুই ভালো মধু, খাঁটি মধু। বাজারে বিক্রি হওয়া বেশিরভাগ মধু প্রক্রিয়াজাত মধু বা Processing Honey। কাঁচা মধু এবং প্রক্রিয়াজাত মধু , এই দুই মধুর মধ্যে স্পষ্ট অনেক পার্থক্য রয়েছে। প্রক্রিয়াজাত করা হয় মধু গরম করার মাধ্যমে। আর মধু গরম করলে মধুর অনেক উপকারিতা নষ্ট হয়ে যায় এবং অনেক সময় ক্ষতিকর হয়ে যেতে পারে। তাই আমাদের অবশ্যই চেষ্টা করতে হবে ভালো মানের Raw Honey বা কাঁচা মধু খাওয়ার জন্য।', 'মৌমাছি যে মধু তৈরি করে মৌচাকে জমা করে, সেই মধুই হচ্ছে কাঁচা মধু বা ‘র হানি’। সেটা গ্রাম গঞ্জের হাতে চাক কাটা মধু হোক বা বাক্সের ভেতরে পোষা মৌমাছি দিয়ে উৎপাদিত মধু হোক। এই দুই প্রকার মৌমাছিই যদি ফুল থেকে মধু সংগ্রহ করে, তাহলে এই দুই প্রকার মধুই ভালো মধু, খাঁটি মধু। বাজারে বিক্রি হওয়া বেশিরভাগ মধু প্রক্রিয়াজাত মধু বা Processing Honey। কাঁচা মধু এবং প্রক্রিয়াজাত মধু , এই দুই মধুর মধ্যে স্পষ্ট অনেক পার্থক্য রয়েছে। প্রক্রিয়াজাত করা হয় মধু গরম করার মাধ্যমে। আর মধু গরম করলে মধুর অনেক উপকারিতা নষ্ট হয়ে যায় এবং অনেক সময় ক্ষতিকর হয়ে যেতে পারে। তাই আমাদের অবশ্যই চেষ্টা করতে হবে ভালো মানের Raw Honey বা কাঁচা মধু খাওয়ার জন্য।\r\n\r\nবাংলাদেশে কালোজিরা ফুলের মধু সংগ্রহের সময় সাধারণত ফেব্রুয়ারি মাসে। মাঠে যখন প্রচুর পরিমাণে কালোজিরা ফুল ফুটতে শুরু করে, তখন মৌ চাষিরা তাদের মৌ বাক্স গুলো কালোজিরার বিশাল বড় ক্ষেতের পাশে স্থাপন করে। তারপর ফুল বৃদ্ধি হওয়ার সাথে সাথেই মৌমাছিরা ওই এলাকা থেকে মধু সংগ্রহ করে তাদের মৌ বাক্সে জমা রাখে। এভাবেই তৈরি হয় সম্পূর্ণ প্রাকৃতিক কালোজিরা ফুলের খাঁটি মধু।', 1, '2023-01-07 23:53:43', '2023-01-08 00:19:06'),
(12, 76, 'লিচু ফুলের মধু (Litchi Flower Raw Honey)', 'সাধারণত লিচু ফুলের খাটি মধু সামান্য জমতে দেখা যায়। যদি মধু পাতলা হয় তাহলে সেটা কয়েকমাস পরে সামান্য জমতে পারে। আর যদি মধু খুবই ঘন হয় তাহলে সেটা দ্রুত জমতে শুরু করে এবং সম্পূর্ণ মধুই জমে যেতে পারে বা বেশীরভাগ জমতে পারে।', 'মৌমাছি যে মধু তৈরি করে মৌচাকে জমা করে, সেই মধুই হচ্ছে কাঁচা মধু বা ‘র হানি’। সেটা গ্রাম গঞ্জের হাতে চাক কাটা মধু হোক বা বাক্সের ভেতরে পোষা মৌমাছি দিয়ে উৎপাদিত মধু হোক। এই দুই প্রকার মৌমাছিই যদি ফুল থেকে মধু সংগ্রহ করে, তাহলে এই দুই প্রকার মধুই ভালো মধু, খাঁটি মধু। বাজারে বিক্রি হওয়া বেশিরভাগ মধু প্রক্রিয়াজাত মধু বা Processing Honey। কাঁচা মধু এবং প্রক্রিয়াজাত মধু , এই দুই মধুর মধ্যে স্পষ্ট অনেক পার্থক্য রয়েছে। প্রক্রিয়াজাত করা হয় মধু গরম করার মাধ্যমে। আর মধু গরম করলে মধুর অনেক উপকারিতা নষ্ট হয়ে যায় এবং অনেক সময় ক্ষতিকর হয়ে যেতে পারে। তাই আমাদের অবশ্যই চেষ্টা করতে হবে ভালো মানের Raw Honey বা কাঁচা মধু খাওয়ার জন্য।\r\n\r\nবাংলাদেশে লিচু ফুলের মধু সংগ্রহের সময় সাধারণত মার্চ মাসে। বড় বড় লিচু বাগানে যখন প্রচুর পরিমাণে লিচু ফুল ফুটতে শুরু করে, তখন মৌ চাষিরা তাদের মৌ বাক্স গুলো লিচু বাগানের মধ্যে স্থাপন করে। তারপর ফুল বৃদ্ধি হওয়ার সাথে সাথেই মৌমাছিরা ওই এলাকা থেকে মধু সংগ্রহ করে তাদের মৌ বাক্সে জমা রাখে। এভাবেই তৈরি হয় সম্পূর্ণ প্রাকৃতিক লিচু ফুলের খাঁটি মধু।', 1, '2023-01-07 23:56:28', '2023-01-07 23:56:28'),
(13, 77, 'মধুময় বাদাম (Honey Nut)', '👉প্রোডাক্ট হাতে পেয়ে পেমেন্ট করার সুবিধা + ফ্রি হোমডেলিভারি !!!\r\n🔥রোগ প্রতিকারের চেয়ে প্রতিরোধ ব্যবস্থাই উত্তম🔥\r\nঅতুলনীয় সুস্বাদু এই স্পেশাল মধুময় বাদাম শুধু রোগ প্রতিরোধ ক্ষমতাই বৃদ্ধি করে না, একই সাথে এনার্জি বৃদ্ধিতে বিশাল ভূমিকা রাখে।\r\n👉বাচ্চা থেকে বৃদ্ধ সব বয়সীদের জন্য দারুণ ভাবে উপকার করে স্পেশাল এই হানি নাটস🔥', '👉প্রোডাক্ট হাতে পেয়ে পেমেন্ট করার সুবিধা + ফ্রি হোমডেলিভারি !!!\r\n🔥রোগ প্রতিকারের চেয়ে প্রতিরোধ ব্যবস্থাই উত্তম🔥\r\nঅতুলনীয় সুস্বাদু এই স্পেশাল মধুময় বাদাম শুধু রোগ প্রতিরোধ ক্ষমতাই বৃদ্ধি করে না, একই সাথে এনার্জি বৃদ্ধিতে বিশাল ভূমিকা রাখে।\r\n👉বাচ্চা থেকে বৃদ্ধ সব বয়সীদের জন্য দারুণ ভাবে উপকার করে স্পেশাল এই হানি নাটস🔥\r\n\r\n👉প্রোডাক্ট হাতে পেয়ে পেমেন্ট করার সুবিধা + ফ্রি হোমডেলিভারি !!!\r\n🔥রোগ প্রতিকারের চেয়ে প্রতিরোধ ব্যবস্থাই উত্তম🔥\r\nঅতুলনীয় সুস্বাদু এই স্পেশাল মধুময় বাদাম শুধু রোগ প্রতিরোধ ক্ষমতাই বৃদ্ধি করে না, একই সাথে এনার্জি বৃদ্ধিতে বিশাল ভূমিকা রাখে।\r\n👉বাচ্চা থেকে বৃদ্ধ সব বয়সীদের জন্য দারুণ ভাবে উপকার করে স্পেশাল এই হানি নাটস🔥\r\n\r\n👉প্রোডাক্ট হাতে পেয়ে পেমেন্ট করার সুবিধা + ফ্রি হোমডেলিভারি !!!\r\n🔥রোগ প্রতিকারের চেয়ে প্রতিরোধ ব্যবস্থাই উত্তম🔥\r\nঅতুলনীয় সুস্বাদু এই স্পেশাল মধুময় বাদাম শুধু রোগ প্রতিরোধ ক্ষমতাই বৃদ্ধি করে না, একই সাথে এনার্জি বৃদ্ধিতে বিশাল ভূমিকা রাখে।\r\n👉বাচ্চা থেকে বৃদ্ধ সব বয়সীদের জন্য দারুণ ভাবে উপকার করে স্পেশাল এই হানি নাটস🔥', 1, '2023-01-08 00:07:18', '2023-01-08 00:07:18'),
(15, 79, 'সরিষা ফুলের জমা মধু (Mustard Flower Raw Honey)', 'মৌমাছি যে মধু তৈরি করে মৌচাকে জমা করে, সেই মধুই হচ্ছে কাঁচা মধু বা ‘র হানি’। সেটা গ্রাম গঞ্জের হাতে চাক কাটা মধু হোক বা বাক্সের ভেতরে পোষা মৌমাছি দিয়ে উৎপাদিত মধু হোক। এই দুই প্রকার মৌমাছিই যদি ফুল থেকে মধু সংগ্রহ করে, তাহলে এই দুই প্রকার মধুই ভালো মধু, খাঁটি মধু। বাজারে বিক্রি হওয়া বেশিরভাগ মধু প্রক্রিয়াজাত মধু বা Processing Honey। কাঁচা মধু এবং প্রক্রিয়াজাত মধু , এই দুই মধুর মধ্যে স্পষ্ট অনেক পার্থক্য রয়েছে। প্রক্রিয়াজাত করা হয় মধু গরম করার মাধ্যমে। আর মধু গরম করলে মধুর অনেক উপকারিতা নষ্ট হয়ে যায় এবং অনেক সময় ক্ষতিকর হয়ে যেতে পারে। তাই আমাদের অবশ্যই চেষ্টা করতে হবে ভালো মানের Raw Honey বা কাঁচা মধু খাওয়ার জন্য।', 'মৌমাছি যে মধু তৈরি করে মৌচাকে জমা করে, সেই মধুই হচ্ছে কাঁচা মধু বা ‘র হানি’। সেটা গ্রাম গঞ্জের হাতে চাক কাটা মধু হোক বা বাক্সের ভেতরে পোষা মৌমাছি দিয়ে উৎপাদিত মধু হোক। এই দুই প্রকার মৌমাছিই যদি ফুল থেকে মধু সংগ্রহ করে, তাহলে এই দুই প্রকার মধুই ভালো মধু, খাঁটি মধু। বাজারে বিক্রি হওয়া বেশিরভাগ মধু প্রক্রিয়াজাত মধু বা Processing Honey। কাঁচা মধু এবং প্রক্রিয়াজাত মধু , এই দুই মধুর মধ্যে স্পষ্ট অনেক পার্থক্য রয়েছে। প্রক্রিয়াজাত করা হয় মধু গরম করার মাধ্যমে। আর মধু গরম করলে মধুর অনেক উপকারিতা নষ্ট হয়ে যায় এবং অনেক সময় ক্ষতিকর হয়ে যেতে পারে। তাই আমাদের অবশ্যই চেষ্টা করতে হবে ভালো মানের Raw Honey বা কাঁচা মধু খাওয়ার জন্য।\r\n\r\nমৌমাছি যে মধু তৈরি করে মৌচাকে জমা করে, সেই মধুই হচ্ছে কাঁচা মধু বা ‘র হানি’। সেটা গ্রাম গঞ্জের হাতে চাক কাটা মধু হোক বা বাক্সের ভেতরে পোষা মৌমাছি দিয়ে উৎপাদিত মধু হোক। এই দুই প্রকার মৌমাছিই যদি ফুল থেকে মধু সংগ্রহ করে, তাহলে এই দুই প্রকার মধুই ভালো মধু, খাঁটি মধু। বাজারে বিক্রি হওয়া বেশিরভাগ মধু প্রক্রিয়াজাত মধু বা Processing Honey। কাঁচা মধু এবং প্রক্রিয়াজাত মধু , এই দুই মধুর মধ্যে স্পষ্ট অনেক পার্থক্য রয়েছে। প্রক্রিয়াজাত করা হয় মধু গরম করার মাধ্যমে। আর মধু গরম করলে মধুর অনেক উপকারিতা নষ্ট হয়ে যায় এবং অনেক সময় ক্ষতিকর হয়ে যেতে পারে। তাই আমাদের অবশ্যই চেষ্টা করতে হবে ভালো মানের Raw Honey বা কাঁচা মধু খাওয়ার জন্য।', 1, '2023-01-08 00:10:07', '20