(16, 80, '৪ প্রকার মধু চার বোতল – মোট ১ কেজি (Combo Package)', '৪ প্রকার মধু ৪ বোতলে মোট ১ কেজি মধু থাকবে। এটি একটি কম্ব প্যাকেজ। এই ৪ প্রকার মধুর নাম ও ওজনঃ ২৫০ গ্রাম সুন্দরবনের মধু + ২৫০ গ্রাম লিচু ফুলের মধু + ২৫০ গ্রাম সরিষা ফুলের মধু + ২৫০ গ্রাম কালোজিরা ফুলের মধু।\r\n\r\nএই কম্ব প্যাকেজটি বানানো হয়েছে সাধারণ মধু ক্রেতাদের উপকারের জন্য। অনেকেই বুঝতে পারেন না যে, কোন ফুলের মধু কেনবেন? কোন ফুলের মধুর স্বাদ কেমন? ঘ্রাণ কেমন? ইত্যাদি। তাই তাদের প্রতি উদ্দেশ্য করেই এই কম্ব প্যাকেজটি বানানো হয়েছে। যাতে করে তারা অল্প অল্প পরিমাণে মধু নিয়ে বুঝতে পারেন যে, কোন মধুটা বেশি ভালো লাগছে তার কাছে। তার জন্য কোন মধুটা কেনা উচিত? এটা জানার পরে বেশি পরিমাণে ওই মধুটা কিনলে ক্রেতা এবং বিক্রেতা উভয়ের জন্যই কল্যাণকর হবে ইনশাআল্লাহ। আপনি যেই মধুই কেনেন না কেনো? মধু কেনার আগেই অবশ্যই মধুর বৈশিষ্ট্য জেনে নেওয়া জরুরি।', '৪ প্রকার মধু ৪ বোতলে মোট ১ কেজি মধু থাকবে। এটি একটি কম্ব প্যাকেজ। এই ৪ প্রকার মধুর নাম ও ওজনঃ ২৫০ গ্রাম সুন্দরবনের মধু + ২৫০ গ্রাম লিচু ফুলের মধু + ২৫০ গ্রাম সরিষা ফুলের মধু + ২৫০ গ্রাম কালোজিরা ফুলের মধু।\r\n\r\nএই কম্ব প্যাকেজটি বানানো হয়েছে সাধারণ মধু ক্রেতাদের উপকারের জন্য। অনেকেই বুঝতে পারেন না যে, কোন ফুলের মধু কেনবেন? কোন ফুলের মধুর স্বাদ কেমন? ঘ্রাণ কেমন? ইত্যাদি। তাই তাদের প্রতি উদ্দেশ্য করেই এই কম্ব প্যাকেজটি বানানো হয়েছে। যাতে করে তারা অল্প অল্প পরিমাণে মধু নিয়ে বুঝতে পারেন যে, কোন মধুটা বেশি ভালো লাগছে তার কাছে। তার জন্য কোন মধুটা কেনা উচিত? এটা জানার পরে বেশি পরিমাণে ওই মধুটা কিনলে ক্রেতা এবং বিক্রেতা উভয়ের জন্যই কল্যাণকর হবে ইনশাআল্লাহ। আপনি যেই মধুই কেনেন না কেনো? মধু কেনার আগেই অবশ্যই মধুর বৈশিষ্ট্য জেনে নেওয়া জরুরি।\r\n\r\nসরিষা ফুলের মধু ঘন হোক বা পাতলা হক- এটা সারা বছরই জমে থাকে। ঘন-পাতলা এবং তাপমাত্রার উপরে নির্ভর করে সম্পূর্ণ মধু বা বেশীরভাগ মধু জমে সাদা হয়ে থাকে। যেটা একেবারে ক্রিম এর মতো দেখা যায়।\r\nসরিষা ফুলের মধু ঘন হোক বা পাতলা হক- এটা সারা বছরই জমে থাকে। ঘন-পাতলা এবং তাপমাত্রার উপরে নির্ভর করে সম্পূর্ণ মধু বা বেশীরভাগ মধু জমে সাদা হয়ে থাকে। যেটা একেবারে ক্রিম এর মতো দেখা যায়।', 1, '2023-01-08 00:14:05', '2023-01-08 00:14:05'),
